  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144340 includes discrete
  sample and profile data collected from NOAA Ship GORDON GUNTER in the North Atlantic
  Ocean and Stellwagen Bank National Marine Sanctuary from 2013-06-09 to 2013-11-25.
  These data include AMMONIUM (NH4), DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, nitrate
  + nitrite content (concentration), pH, phosphate and silicate. The instruments used
  to collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement,
  bottle and spectrophotometer.nnThese data were collected by Rik Wanninkhof of US
  DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory as part of
  the Gordon_Gunter_Coastal_Cruises_2013 data set. CDIAC associated the following
  cruise ID(s) with this data set: GU1302 and GU1305nnThe Global Coastal Carbon Data
  Project data includes the bottle (discrete) and surface (underway) carbon-related
  measurements from coastal research cruises, the data from time series cruises and
  coastal moorings. The coastal regions data are very important for the understanding
  of carbon cycle on the continental margins.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
